import React from 'react';
import './Header.css';
import BekoImage from './images/New_Beko_logo.svg.png';

const Header = () => {
  return (
    <header className='Header-holder'>
      <h1>My App Header</h1>
      <div className='image-holder'>
        <img src={BekoImage} alt="Beko Logo" />
      </div>
    </header>
  );
}

export default Header;
